def convert_audio_file(path: str) -> str:
    split = path.split('.')
    last = split[-1]

    if last == 'wav':
        return path
    
    new_path = '.'.join(split[:-1]) + '.wav'

    if os.path.exists(new_path) is False:
        subprocess.call(['ffmpeg', '-i', path, new_path, '-y'])

    return new_path


